var rsrGroups = [];            
            
// Iterate through the regions & change Yorkshire's fill colour to gold

for (var i = 0; i < regions.length; i++) {
   
    // Showing off
    regions[i].mouseover(function(e){
        this.node.style.opacity = 0.7;
        var posx;
        var posy;

        if (typeof e !== 'undefined') {
            posx = e.pageX - $map.offset().left - 70+150;
            posy = e.pageY - $map.offset().top - 67+150;
        } else {
            // console.log(building);
            posx = parseInt(regions[i].getBBox().x, 10) - 60;
            posy = parseInt(regions[i].getBBox().y, 10) - 57;
        }

        console.log(posx, posy);

        $infobox.css({
            'display': 'initial',
            'top': posy-100 + 'px',
            'left': posx-50 + 'px'
        });

        $infobox.find('.infobox__title').text(this.data('region'));
    });

    regions[i].mouseout(function(e){
        this.node.style.opacity = 1;  
        $infobox.css({
            'display': 'none'
        });
    });


}

